-- ----------------------------
-- Table structure for districts
-- ----------------------------
DROP TABLE IF EXISTS `districts`;
CREATE TABLE `districts` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增编号',
  `parent_id` int(11) NOT NULL DEFAULT '0' COMMENT '父级编号',
  `name` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '行政名称',
  `level` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '行政级别',
  `adcode` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '行政编码',
  `center` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '经纬度',
  `sortnum` int(11) NOT NULL DEFAULT '0' COMMENT '排序',
  `enabled` enum('0','1') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '0' COMMENT '是否启用[0-否 1-是]',
  `gmt_created` datetime DEFAULT NULL,
  `gmt_modified` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3726 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='地区表';

