-- Records of districts
-- ----------------------------

-- ----------------------------
-- Table structure for school
-- ----------------------------
DROP TABLE IF EXISTS `school`;
CREATE TABLE `school` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `company_id` int(10) unsigned DEFAULT '0',
  `warehouse_id` int(10) unsigned DEFAULT '0',
  `name` varchar(225) DEFAULT NULL,
  `province` int(11) DEFAULT NULL COMMENT '省',
  `city` int(11) DEFAULT NULL COMMENT '市',
  `district` int(11) DEFAULT NULL COMMENT '区',
  `address` text,
  `lat` float unsigned DEFAULT '0' COMMENT '经度',
  `lng` float unsigned DEFAULT '0' COMMENT '维度',
  `province_name` varchar(225) DEFAULT NULL COMMENT '省',
  `city_name` varchar(225) DEFAULT NULL COMMENT '市',
  `district_name` varchar(225) DEFAULT NULL COMMENT '区',
  `night_hour` int(10) unsigned DEFAULT '22',
  `manager_salary_percent` float unsigned DEFAULT '3' COMMENT '代理管理员抽成比例',
  `agent_salary_percent` float unsigned DEFAULT '12' COMMENT '派送员抽成比例',
  `status` tinyint(1) unsigned DEFAULT '0' COMMENT '0: 有效   1: 无效',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `adcode` varchar(255) DEFAULT NULL COMMENT '行政编码',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=16201 DEFAULT CHARSET=utf8;

